import React from "react";

export default function CommandsInput(props) {
    return props.commands.map((val, idx) => {
        let nameId = `name-${idx}`;
        let commandId = `command-${idx}`;

        return (
            <div key={idx}>
                <label htmlFor={nameId}>{`Name #${idx + 1}`}</label>
                <input
                    type="text"
                    name={nameId}
                    data-id={idx}
                    className="command-name"
                />
                <label htmlFor={commandId}>{`Command #${idx + 1}`}</label>
                <input
                    type="text"
                    name={commandId}
                    data-id={idx}
                    className="command-id"
                />
            </div>
        );
    });
}
